import styled from "styled-components";

export const Container = styled.section`
 position: relative;
 top:300px;
 left:60%;
 width:300px;
 border-radius: 3px;
 border-bottom: 1px solid rgb(4, 0, 240);   
 height:350px;
 background: #333;
font-family: 'Hina Mincho', serif;
& h1{
    font-size:50px;
    
}
`;
